import React from 'react';

// COMPONENTS
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons';

// CSS
import '../css/Interests.css'

export default class Interests extends React.Component {
    state = {
        page: 0
    }


    render() {
        return (

            <div>

                {/* <h1>Interests</h1> */}

                {/* <ul>
                    <li>Sci-fi</li>
                    <li>Garageband / music making</li>
                    <li>Photography</li>
                    <li>Reading</li>
                </ul> */}

                <Parallax className = 'Parallax' ref={ref => (this.parallax = ref)} pages={2} style = {{ 'height': '90vh' }}>
                    <ParallaxLayer className = 'Title' speed={1} offset={0} factor = {.3} style = {{ 'backgroundColor': 'red' , 'height': '100px' }}>
                        <div>
                            <h1>Interests</h1>
                        </div>
                    </ParallaxLayer>

                    <ParallaxLayer className = 'Title' speed={.5} offset={.2} factor = {.3}>
                        <div>
                            <h1>SCI FI</h1>
                        </div>
                    </ParallaxLayer>

                    <ParallaxLayer className='SciFiBase' speed={-.01} offset={.5} factor = {.3} style={{ width: '100%', height: '300px' , margin: '0 auto', backgroundSize: '100%' }}>
                        <ParallaxLayer className='SciFiCar' speed={-.01} offset={.6} factor = {.3} style={{ width: '100%' , margin: '0 auto', backgroundSize: '20%' }}/>
                    </ParallaxLayer>

                </Parallax>

            </div>

        )
    }

}
